n    // Acceder al query params\n    this.role =  this.route.snapshot.queryParamMap.get('role');\n    // Validar mediante API\n    console.log(\"https://medicalportal.herokuapp.com/api/v1/login/\"+this.role);\n    let _url =\"https://medicalportal.herokuapp.com/api/v1/login/\"+this.role;\n    var self = this;\n    this.http.post(_url, \n      {\n      email : this.loginForm.get(\"mail\").value,\n      password : this.loginForm.get(\"pass\").value,\n      }\n      ).subscribe(data => {\n      let key = data.token;\n      let role = self.role;\n      let id = data.id;\n      localStorage.setItem('token', key );\n      localStorage.setItem('role', role );\n      localStorage.setItem('login', '1' );\n      localStorage.setItem('id' , id );\n    this.router.navigate(['home']);\n    },\n    error => {\n      alert(\"Usuario y/o contraseña erróneo\");\n      localStorage.setItem('login', '0' );\n    console.log(error);\n    }\n   );\n\n  }\n\n}\n/** \n * Error when invalid control is dirty, touched, or submitted. \n **/\nexport class MyErrorStateMatcher implements ErrorStateMatcher {\n  /**\n   * Variable que valida el correo\n   * @param control \n   * @param form \n   * @returns boolean\n   */\n  isErrorState(control: FormControl | null, form: FormGroupDirective | NgForm | null): boolean {\n    const isSubmitted = form && form.submitted;\n    return !!(control && control.invalid && (control.dirty || control.touched || isSubmitted));\n  }\n}\n    \n\n\n\n\n                   \n\n\n\n\n                   \n    \n         result-matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"interfaces/NewsInterface.html":{"url":"interfaces/NewsInterface.html","title":"interface - NewsInterface","body":"\n                   \n\n\n\n\n\n\n\n\n\n\n\n\n\n  Interfaces\n  NewsInterface\n\n\n\n        \n            Info\n        \n        \n            Source\n        \n\n\n\n    \n        \n            File\n        \n        \n            src/app/interfaces/n